window.bookSummaryJSON = "<p>Disney-Pixar's <i>Finding Dory</i> reunites everyone's favorite forgetful blue tang, Dory, with her friends, Nemo and Marlin, on a search for answers about her past. What can she remember? Who are her parents? And where did she learn to speak Whale? </p> <p>Directed by Andrew Stanton (<i>Finding Nemo</i>, <i>WALL-E</i>) and produced by Lindsey Collins (coproducer, <i>WALL-E</i>), the film features the voices of Ellen DeGeneres, Albert Brooks, Ed O'Neill, Kaitlin Olson, Ty Burrell, Eugene Levy, and Diane Keaton. <i>Finding Dory</i> swims into theaters June 17, 2016. </p>"; 
